  useEffect(() => {
    getBackendData();
  }, []);

 async function getBackendData() {
    try {
      const response = await axios.get("http://localhost:5000/api")
      setbackendData(response.data)

    }

    catch(error) {
     console.log("error" + error);
    }
  }

  return (
    <div className="App">
      <h1>Lokal App for Local People</h1>
      <h3>{backendData}</h3>
    </div>
  );
}

export default App;
